const fs = require('fs')
const path = require('path')
const configDir = require('./dirs/configDir')()
const systrayPath = path.join(configDir, 'assets', 'forked-systray')

const open = require('./open')
const proxy = require('./proxy')
const addon = require('./addon')

function openBrowser() {
    const endpoint = proxy.getEndpoint()
    open(endpoint + '/')
}

function startWeb() {
    const endpoint = proxy.getEndpoint()
    open('http://app.strem.io/shell-v4.4/#/?addonOpen=' + encodeURIComponent(endpoint + '/catalog.json'))
}

function startApp() {
    const endpoint = proxy.getEndpoint()
    open(endpoint.replace(/https?:\/\//, 'stremio://') + '/catalog.json')
}

function makeQr() {
    const endpoint = proxy.getEndpoint()
    const url = endpoint.replace(/https?:\/\//, 'stremio://') + '/catalog.json'
    const qrUrl = 'http://api.qrserver.com/v1/create-qr-code/?color=000000&bgcolor=FFFFFF&data=' + encodeURIComponent(url) + '&qzone=1&margin=0&size=400x400&ecc=L'
    open(qrUrl)
}

function restart() {
    addon.restart()
}

function die() {
    process.emit('SIGINT')
}

function haveSystrayBinary() {
    const isWin = process.platform === 'win32'
    const binaryName = 'systrayhelper' + (isWin ? '.exe' : '')
    let binaryFolder
    if (fs.existsSync(path.join(systrayPath, binaryName)))
        binaryFolder = systrayPath
    else {
        let tempPath = path.join(__dirname, '..', 'node_modules', 'forked-systray')
        if (fs.existsSync(tempPath)) {
            binaryFolder = tempPath
        }
    }
    if (!binaryFolder) {
        console.log('PimpMyStremio - Could not find systray module path, skipping')
        return false
    }
    const binaryLoc = path.join(binaryFolder, binaryName)
    if (!fs.existsSync(binaryLoc)) {
        console.log('PimpMyStremio - Could not find systray binary path, skipping')
        return false
    }
    const binaryStats = fs.statSync(binaryLoc)
    if (((binaryStats || {}).size || 0) < 1000000) {
        console.log('PimpMyStremio - Invalid systray binary, skipping')
        return false
    }
    return true
}

let systray = false

module.exports = {
    init: () => {
        
        if (!haveSystrayBinary())
            return

        const SysTray = require(fs.existsSync(systrayPath) ? systrayPath : 'forked-systray').default

        const isRemote = proxy.getEndpoint().startsWith('https://')

        const items = [ {
            title: "Open in Browser",
            checked: false,
            enabled: true
        }, {
            title: "Load in Stremio Web",
            checked: false,
            enabled: true
        }, {
            title: "Load in Stremio App",
            checked: false,
            enabled: true
        } ]

        if (isRemote)
            items.push({
                title: "Load with QR Code",
                checked: false,
                enabled: true
            })

        items.push({
            title: "Restart",
            checked: false,
            enabled: true   
        })

        items.push({
            title: "Exit",
            checked: false,
            enabled: true   
        })

        function base64image() {
            const base64png = ''
            const base64icon = ''
            return process.platform === 'win32' ? base64icon : base64png
        }

        systray = new SysTray({
            menu: {
                icon: base64image(),
                tooltip: "PimpMyStremio",
                items
            },
    //        copyDir: true,
        })

        systray.on('click', action => {
            if (action.seq_id === 0) {
                openBrowser()
            } else if (action.seq_id === 1) {
                startWeb()
            } else if (action.seq_id === 2) {
                startApp()
            } else if (action.seq_id === 3) {
                if (isRemote) makeQr()
                else restart()
            } else if (action.seq_id === 4) {
                if (isRemote) restart()
                else die()
            } else if (action.seq_id === 5) {
                die()
            }
        })
    },
    kill: () => {
        return new Promise((resolve, reject) => {
            if (systray)
                systray.kill(false)
            setTimeout(() => {
                resolve()
            })
        })
    }
}
